import React from 'react';
import './HomePage.css';

const HomePage = () => {
    return (
        <div className='home-page'>
            <h1>Welcome to my Portfolio</h1>
            <p>This is the home page where I'll showcase my projects and articles.</p>
        </div>
    );
};

export default HomePage;
